**Reformatted Question:** Mrs. Hilt spent <fact1>74 cents</fact1> at the school store. She bought a notebook for <fact2>35 cents</fact2>, a ruler for <fact3>18 cents</fact3>, and <fact4>3 pencils</fact4>. What is the cost of <target>one pencil</target>?

**Answer:**

Mrs. Hilt spent a total of <fact1>74 cents</fact1>.  The notebook and ruler cost <fact2>35 cents</fact2> + <fact3>18 cents</fact3> = 53 cents.  This means the <fact4>3 pencils</fact4> cost <fact1>74 cents</fact1> - 53 cents = 21 cents. Since she bought <fact4>3 pencils</fact4> for 21 cents, each pencil costs 21 cents / <fact4>3</fact4> = 7 cents. The cost of <target>one pencil</target> is 7 cents. {7}

                    Reformatted Question:                         Answer:

Edward had beaten <fact1>24 levels</fact1> in a video game. If the ratio of levels he had beaten to not beaten was <fact2>3:1</fact2>, how many levels does the game have total?


The ratio of beaten levels to not beaten levels is <fact2>3:1</fact2>. This means that for every 3 levels Edward beat, there was 1 level he hadn't beaten.  Since Edward beat <fact1>24 levels</fact1>, we can set up a proportion: 3/1 = 24/x, where x is the number of levels not beaten.  Solving for x, we get x = 8.  So Edward had not beaten 8 levels.  The total number of levels is the sum of beaten and not beaten levels: <fact1>24</fact1> + 8 = 32.  Therefore, the game has a total of 32 levels. {32}
